    [],nt"revision_timestamp": "2016-04-26T01:03:06.883250",nt"name": "united-states-interagency-elevation-inventory-usiei",nt"isopen":
    false,nt"url": null,nt"notes": "The U.S. Interagency Elevation Inventory
    displays high-accuracy topographic and bathymetric data for the United States and
    its territories. The project is a collaborative effort between NOAA, the U.S. Geological
    Survey, the Federal Emergency Management Agency, the U.S. Department of Agriculture,
    the U.S. Forest Service and the U.S. Army Corps of Engineers. This resource is a
    comprehensive, nationwide listing of known high-accuracy topographic data, including
    lidar and IfSAR, and bathymetric data,including NOAA hydrographic surveys, multibeam
    data, and bathymetric lidar. The following data layers are updated annually, with
    minor updates occurring during the year: topographic lidar, topobathy shoreline
    lidar, IfSAR data, and bathymetric lidar. The NOAA hydrographic surveys, the multibeam
    and trackline bathymetry shown are provided via a service that is available from
    the NOAA National Centers for Environmental Information (NCEI). Access the bathymetric
    data directly from the NCEI at: http://maps.ngdc.noaa.gov/viewers/bathymetry/ The
    US Army Corps of Engineers (USACE) dredge surveys are provided via a NOAA MarineCadastre
    service. The information provided for each elevation dataset includes many attributes
    such as vertical accuracy, point spacing, and date of collection. A direct link
    to access the data or information about the contact organization is also available
    through the inventory.",nt"license_title": null,nt"extras": [{ntt"key":
